import React from 'react'
import {NavLink} from "react-router-dom";
import rock from '../assets/1.jpg'
import scissor from '../assets/2.png'
import paper from '../assets/3.png'


export const MainC = (props) => {
    return (
        <>
            <NavLink to='/game'>
                <img className='rock' src={rock} alt="" name='r' onClick={props.userStepOnClick}/>
                <img className='scissor' src={scissor} alt="" name='s' onClick={props.userStepOnClick}/>
                <img className='paper' src={paper} alt="" name='p' onClick={props.userStepOnClick}/>
            </NavLink>
        </>
    )
}
